		var colseAll = function(){ // 页面关闭时回调
			addressSelectShengBox.fadeOut(settings.closeSpeed);
			addressSelectShiBox.fadeOut(settings.closeSpeed);
			addressSelectQuBox.fadeOut(settings.closeSpeed);
			addressSelectXiangBox.fadeOut(settings.closeSpeed);
			addressSelectCunBox.fadeOut(settings.closeSpeed);
			// 界面关闭回调
			settings.callBackOnClose && settings.callBackOnClose();
		}
