				addressSelectShengBox.children('h1').children('span').attr('autocomplete','off').on('click', function(){ // 确认关闭按钮
					colseAll();
				});
				$(".address_sheng", context).on("click", function(event){
					event.stopPropagation();
					openAddressSelectShengBox(true,true);
				});
				$(".address_shi", context).on("click", function(event){
					event.stopPropagation();
					openAddressSelectShiBox(true,true)
				});
				$(".address_qu", context).on("click", function(event){
					event.stopPropagation();
					openAddressSelectQuBox(true,true);
				});
				$(".address_xiang", context).on("click", function(event){
					event.stopPropagation();
					openAddressSelectXiangBox(true,true);
				});
				$(".address_cun", context).on("click", function(event){
					event.stopPropagation();
					openAddressSelectCunBox(true,true);
				});
				$(".address_shi,.address_qu,.address_xiang,.address_cun",context).hide();
				//绑定输入框事件
				addressSelectShengBox.children('h1').children('input').bigAutocomplete({data:window.searchDataForAddress,callback:function(data){
					setDataAllForSearchInput(data);
					self.val(data.result.name+"-("+data.result.code+")");
					addressSelectShengBox.children('h1').children('input').val(data.result.name);
					colseAll();
				}});
